window.bookSummaryJSON = "<p><b>To save my father's life, I'm being forced to marry a monster.</b></p> <p>The world sees Gabriel Black as a golden god: successful, gorgeous, charismatic, and untouchable. The good guy.</p> <p>But I've peeked behind the mask and seen the brutal devil that lurks like poison under the surface. And he knows it, too.</p> <p>Now, I need a miracle—and money—to save my father's life and pay off the crime boss he's in deep with.</p> <p>Gabriel needs a wife to further his political career. It's a match made in hell to a secret psychopath who knows my darkest, most depraved fantasies.</p> <p>And I'm about to learn the only thing more dangerous than being chased by a monster:</p> <p>Falling for one.</p> <p>Poisonous Kiss <i>is a blisteringly steamy, dark mafia, grumpy/sunshine, marriage of convenience standalone romance by bestselling author Jagger Cole. It features a smart, untamable heroine and an ultra possessive psycho hero with \"look at her and I'll unalive you\" energy. No cliffhanger. HEA included. For mature listeners.</i></p>"; 
